class Solution {
public:
int maxOperations(string s) {
    int res=0;
    int count=0;
    bool f=false;
    for(auto v:s){
        if(v=='1'){
            ++count;
            f=true;
        }else{
            if(f)
            res+=count;
            f=false;
        }
    }
    return res;
}
};
